import React from 'react';
import './App.css';
import head from './images/head.png'
function App() {
  return (
      <div className='App'>
        <div className='header'>
            <ul className='flex flex-row pt-6 pb-6'>
              <li className='basis-1/4 align-bottom text-center self-center	' ><a href="/" className='text-slate-400 hover:text-white hover:font-bold hover:underline hover:decoration-vivid-orange/75 decoration-2 hover:tracking-widest'>Events</a></li>
              <li className='basis-1/4 align-bottom text-center self-center	' ><a href="/" id='home' className='text-slate-400 hover:text-white hover:font-bold hover:underline hover:decoration-pure-red/75 decoration-2 rounded-l-lg hover:tracking-widest'>Home</a></li>
              <img src={head} className='basis-1/2 scale-50 ' alt="" />
              <li className='basis-1/4 align-bottom text-center self-center	'><a href="/" className='text-slate-400 hover:text-white hover:font-bold hover:underline hover:decoration-bright-blue/75 decoration-2 hover:tracking-widest'>About</a></li>
              <li className='basis-1/4 align-bottom text-center'><a href="/" className='text-slate-400 hover:text-white hover:font-bold hover:underline hover:decoration-dark-moderate-cyan/75 decoration-2 rounded-r-lg hover:tracking-widest' >Contact Us</a></li>
            </ul>
        </div>
        <div className='bg-clip-padding'>
          <video autoPlay loop muted plays-inline="true" className='opacity-50'> <source src='https://storage.cloudconvert.com/tasks/8129e198-ad9d-47a2-8507-7a5328d6627e/background.mp4?AWSAccessKeyId=cloudconvert-production&Expires=1675955980&Signature=QcGFyJ95wmqpy3uzWbVcyBeoSkI%3D&response-content-disposition=attachment%3B%20filename%3D%22background.mp4%22&response-content-type=video%2Fmp4' type='video/mp4' /> </video>
        </div>
      </div>
    )
}

export default App;
